import React from 'react'


const School = (props) => {

    const add_school=(school)=>{
        props.add_school(school)
        console.log(school)
    }
    return (
        <div className="App bg-light">

            <h2 className='text-center'>Search Best school in Nepal :</h2>
            <button className="btn btn-primary" onClick={() => add_school(props.schools.length)}>Add Schools</button>
            <div className="school_list mt-4 col">
            
                {props.schools.map(school_name => {
                    return (
                        <>
                            <div className="schools">
                                <div className={school_name.name}>
                                    <h2>{school_name.name}</h2>
                                    <img src={school_name.img_school_link} alt="" height={200} width={200} />
                                    <p>
                                        About School :
                                        {school_name.discription}
                                    </p>
                                    
                                  
                                </div>
                            </div>
                            {/* Id name : {id} */}
                        </>
                    )
                })}
            </div>
        </div>
    );
}


export default School;
